import React from 'react';
import "./styles/Contracts.css";

const ContractData = (props) => (
    <React.Fragment>
        <p>Name: {props.contract.name}</p>
        <p>Start: {props.contract.startDate}</p>
        <p>Ende: {props.contract.endDate}</p>
        <p>Preis: {props.contract.priceBeginn}</p>
        <p>Beschreibung: {props.contract.description}</p>
    </React.Fragment>
);

const Contract = props => (
    
    <div className="contractBox" >
        <ContractData contract={props.contract}></ContractData>
    </div>
);

export default Contract;
